import React, { useEffect, useState } from "react";
import axios from "axios";
import {
  Box,
  Typography,
  Grid,
  Checkbox,
  Divider,
  CircularProgress,
  Paper,
} from "@mui/material";

const ComparePage = () => {
  const [car1, setCar1] = useState(null);
  const [car2, setCar2] = useState(null);
  const [loading, setLoading] = useState(true);

  const user = JSON.parse(sessionStorage.getItem("user"));
  const userId = user?.id;

  useEffect(() => {
    if (!userId) return;

    axios
      .get(`http://localhost:3030/api/comparison/${userId}`)
      .then((res) => {
        const dto = res.data;
        setCar1(dto.car1);
        setCar2(dto.car2);
      })
      .catch((err) => {
        console.error("Karşılaştırma verisi alınamadı:", err);
      })
      .finally(() => setLoading(false));
  }, [userId]);

  const isNumeric = (val) => !isNaN(parseFloat(val)) && isFinite(val);

  const renderRow = (label, key) => {
    const val1 = car1?.[key];
    const val2 = car2?.[key];
    const isEqual = val1 === val2;

    const highlight = (v, bold) => (
      <Typography
        sx={{
          fontWeight: bold ? "bold" : "normal",
          color: bold ? "green" : "inherit",
          textAlign: "center",
        }}
      >
        {v}
      </Typography>
    );

    let cell1 = val1;
    let cell2 = val2;

    if (isNumeric(val1) && isNumeric(val2)) {
      const num1 = parseFloat(val1);
      const num2 = parseFloat(val2);
      cell1 = highlight(val1, num1 > num2);
      cell2 = highlight(val2, num2 > num1);
    } else {
      cell1 = highlight(val1, false);
      cell2 = highlight(val2, false);
    }

    return (
      <Grid container spacing={2} alignItems="center" sx={{ py: 1 }} key={key}>
        <Grid item xs={12} md={3}>
          <Typography textAlign="right" color="text.secondary">
            {label}
          </Typography>
        </Grid>
        <Grid item xs={12} md={4}>
          {cell1}
          {isEqual && <Checkbox checked disabled />}
        </Grid>
        <Grid item xs={12} md={4}>
          {cell2}
          {isEqual && <Checkbox checked disabled />}
        </Grid>
      </Grid>
    );
  };

  if (loading) return <CircularProgress sx={{ m: 5 }} />;
  if (!car1 || !car2)
    return <Typography m={5}>Karşılaştırma bulunamadı.</Typography>;

  return (
    <Box p={4}>
      <Typography variant="h4" gutterBottom textAlign="center">
        🚘 Araç Karşılaştırması
      </Typography>

      <Grid
        container
        spacing={4}
        justifyContent="center"
        alignItems="flex-start"
      >
        <Grid item xs={12} md={5}>
          <Paper elevation={3}>
            {car1.images?.[0] && (
              <Box
                component="img"
                src={`data:image/jpeg;base64,${car1.images[0].imageBase64}`}
                alt={`${car1.brand} ${car1.model}`}
                sx={{
                  width: "100%",
                  aspectRatio: "16/9",
                  objectFit: "cover",
                }}
              />
            )}
            <Box p={2}>
              <Typography variant="h6" align="center">
                {car1.brand} {car1.model}
              </Typography>
            </Box>
          </Paper>
        </Grid>

        <Grid item xs={12} md={5}>
          <Paper elevation={3}>
            {car2.images?.[0] && (
              <Box
                component="img"
                src={`data:image/jpeg;base64,${car2.images[0].imageBase64}`}
                alt={`${car2.brand} ${car2.model}`}
                sx={{
                  width: "100%",
                  aspectRatio: "16/9",
                  objectFit: "cover",
                }}
              />
            )}
            <Box p={2}>
              <Typography variant="h6" align="center">
                {car2.brand} {car2.model}
              </Typography>
            </Box>
          </Paper>
        </Grid>
      </Grid>

      <Divider sx={{ my: 4 }} />

      {/* Karşılaştırma Alanı */}
      <Box>
        {renderRow("Fiyat (₺)", "price")}
        {renderRow("Kilometre", "km")}
        {renderRow("Model Yılı", "year")}
        {renderRow("Yakıt Türü", "fuel")}
        {renderRow("İletişim", "contact")}
      </Box>
    </Box>
  );
};

export default ComparePage;
